/**
 *
 * @param image
 * @return an integer between 0 and 35 containing the prediction
 */
int DeepNeuralNetwork::inference(const int image[][INPUT_IMAGE_SIZE]) {
    float input[INPUT_IMAGE_SIZE][INPUT_IMAGE_SIZE];

    for (int i = 0; i < INPUT_IMAGE_SIZE; i++)
        for (int j = 0; j < INPUT_IMAGE_SIZE; j++)
            input[i][j] = image[i][j];

    conv2d_1(input, conv2D_1_filter, conv2d_1_output);
    maxpool2d_1(conv2d_1_output, maxpool_1_output);
    conv2d_2(maxpool_1_output, conv2D_2_filter, conv2d_2_output);
    maxpool2d_2(conv2d_2_output, maxpool_2_output);
//    conv2d_3(maxpool_2_output, conv2D_3_filter, conv2d_3_output);
//    maxpool2d_3(conv2d_3_output, maxpool_3_output);
    flatten(maxpool_2_output, flatten_output);
    dense(flatten_output, dense_output);

    float max = dense_output[0];
    int maxIndex = 0;
    for (int i = 0; i < DENSE_OUTPUT_SIZE; i++) {
        if (dense_output[i] > max) {
            max = dense_output[i];
            maxIndex = i;
        }
    }

    for (int i = 0; i < DENSE_OUTPUT_SIZE; i++) {
        //  std::cout << "Neuron " << i << ": " << dense_output[i] << std::endl;
    }
    char prediction;
    if (maxIndex < 10)
        prediction = maxIndex + '0';
    else
        prediction = maxIndex - 10 + 'A';
    //std::cout << "Inference neuron: " << maxIndex << std::endl;
    //std::cout << "Inference letter: " << prediction << std::endl;
    //std::cout << std::endl;
    return maxIndex;
}

// CONV 1
void DeepNeuralNetwork::conv2d_1(const float input[][CONV2D_1_INPUT_SIZE], const float kernel[][CONV2D_SIZE],
                               float output[][CONV2D_1_OUTPUT_SIZE]) {
    for (int i = 0; i < CONV2D_1_OUTPUT_SIZE; i++) {
        for (int j = 0; j < CONV2D_1_OUTPUT_SIZE; j++) {
            float res = 0;
            for (int k = 0; k < CONV2D_SIZE; k++) {
                for (int m = 0; m < CONV2D_SIZE; m++) {
                    int row = i + k;
                    int col = j + m;
                    float mul = input[row][col] * kernel[k][m];
                    res = res + mul;
                }
            }
            output[i][j] = leaky_relu(res);
        }
    }
}

void DeepNeuralNetwork::maxpool2d_1(const float input[][MAX_POOL_1_INPUT_SIZE], float output[][MAX_POOL_1_OUTPUT_SIZE]) {
    for (int i = 0; i < MAX_POOL_1_OUTPUT_SIZE; i++)
        for (int j = 0; j < MAX_POOL_1_OUTPUT_SIZE; j++)
            output[i][j] = 0;

    for (int y = 0; y < MAX_POOL_1_OUTPUT_SIZE; ++y) {
        for (int x = 0; x < MAX_POOL_1_OUTPUT_SIZE; ++x) {
            for (int i = 0; i < MAX_POOL_SIZE; ++i) {
                for (int j = 0; j < MAX_POOL_SIZE; ++j) {
                    float value = input[y * MAX_POOL_SIZE + i][x * MAX_POOL_SIZE + j];
                    output[y][x] = std::max(output[y][x], value);
                }
            }
        }
    }
}

