void DeepNeuralNetwork::flatten(const float input[][FLATTEN_INPUT_SIZE], float *output) {
    for (int i = 0; i < FLATTEN_INPUT_SIZE; i++)
        for (int j = 0; j < FLATTEN_INPUT_SIZE; j++)
            output[i * FLATTEN_INPUT_SIZE + j] = input[i][j];
}

void DeepNeuralNetwork::dense(const float *input, float *output) {
    for (int i = 0; i < DENSE_OUTPUT_SIZE; i++)
        output[i] = 0;

    for (int i = 0; i < DENSE_INPUT_SIZE; i++)
        for (int j = 0; j < DENSE_OUTPUT_SIZE; j++)
            output[j] += dense_weights[i * DENSE_OUTPUT_SIZE + j] * input[i];
}

float DeepNeuralNetwork::leaky_relu(float x) {
    if (x >= 0)
        return x;
    return 0.01 * x;
}

char DeepNeuralNetwork::label_to_char(int label) {
    if (label < 10)
        return label + '0';
    return label - 10 + 'A';
}
